#Level Data
def Array1DTo2D(d):
  width = d[0]
  data = d[1:]
  height = len(data) // width
  return [[data[x + y * width] for x in range(width)] for y in range(height)], width, height

class Level():
  def __init__(self,data):
    self.data = []
    self.width = 0
    self.height = 0
    self.mouse = (0,0)
    self.cheese = []
    self.goals = []
    self.updateData(data)
  def updateData(self,data):
    self.data, self.width, self.height = Array1DTo2D(data)
    self.cheese = []
    self.goals = []
    for y in range(len(self.data)):
      for x in range(len(self.data[0])):
        if self.data[y][x] == 2:
          self.goals.append((x,y))
        elif self.data[y][x] == 3:
          self.cheese.append((x,y))
        elif self.data[y][x] == 4:
          self.mouse = (x,y)
        elif self.data[y][x] == 5:
          self.cheese.append((x,y))
          self.goals.append((x,y))

